import React from 'react';
import TeamNfo from '../../Elements/teamNfo';

const header = (props) =>{

    const teamNfo = (team) =>{
        return team ? (
            <TeamNfo team={team}/>
        ) : null;
    }

    return(
        <div>
            {teamNfo(props.teamData)}
            {postData(props.date, props.author)}
        </div>
    )
}
export default header;
